import * as S from './bloggy.styles';
import * as GS from '../../styles/global';
import Link from 'next/link';

const Bloggy = ({ posts }) => {
	console.log(posts);
	return (
		<S.BlogContainer>
			{/* Left Side */}
			<div>
				{posts.map((post) => {
					return (
						<S.Blog key={post.excerpt}>
							<li>
								<img src={post.feature_image} />
							</li>
							<li>{post.title}</li>
							<li>{post.excerpt}</li>
						</S.Blog>
					);
				})}
			</div>

			{/* Right Side */}
			<div>
				{posts.map((post) => {
					return (
						<S.TopBlogs key={post.feature_image}>
							<div>
								<img src={post.feature_image} />
							</div>
							<div>
								<p>{post.title}</p>
								<p>{post.created_at}</p>
							</div>
						</S.TopBlogs>
					);
				})}
			</div>
		</S.BlogContainer>
	);
};

export default Bloggy;
